import { Component } from '@angular/core';

@Component({
  selector: 'app-lista-libro',
  templateUrl: './lista-libro.component.html',
  styleUrls: ['./lista-libro.component.css']
})
export class ListaLibroComponent {

}
<!DOCTYPE html>
<html>
<head>
  <title>List of Books</title>
  <style>
    body {
      font-family: Arial, sans-serif;
    }

    table {
      border-collapse: collapse;
      width: 100%;
    }

    th, td {
      padding: 8px;
      text-align: left;
      border-bottom: 1px solid #ddd;
    }

    th {
      background-color: #f2f2f2;
    }
  </style>
</head>
<body>
  <h2>List of Books</h2>
  <table>
    <thead>
      <tr>
        <th>Title</th>
        <th>Reference</th>
        <th>Author</th>
        <th>Price</th>
        <th>Location</th>
      </tr>
    </thead>
    <tbody>
      <tr>
        <td>Book 1 Title</td>
        <td>Book 1 Reference</td>
        <td>Book 1 Author</td>
        <td>Book 1 Price</td>
        <td>Book 1 Location</td>
      </tr>
      <tr>
        <td>Book 2 Title</td>
        <td>Book 2 Reference</td>
        <td>Book 2 Author</td>
        <td>Book 2 Price</td>
        <td>Book 2 Location</td>
      </tr>
      <!-- Add more rows for additional books -->
    </tbody>
  </table>
</body>
</html>
